import React from "react";

function About() {
  return (
    <section className="section">
      <div className="section-title">About the Giveaway</div>
      <p>
        Microsoft is on a mission to empower the next generation of innovators and entrepreneurs. As part of our global outreach, we are offering students and business owners in select countries the chance to get full sponsorship for tools, promotion, and more.
      </p>
      <ul>
        <li>
          <b>Campaign Duration:</b> <span>[Insert Dates]</span>
        </li>
        <li>
          <b>Sponsored by:</b> Microsoft Global Outreach Team
        </li>
      </ul>
    </section>
  );
}

export default About;
